export const Cta = (props) => {
    const pagesDefinition = require("../data/data.json");
    return (
        <section class="cta">
            <div class="container">
                <div class="text-center">
                    <h3>{pagesDefinition.titleCta}</h3>
                    <p>{pagesDefinition.textCta}</p>
                    <a class="cta-btn" href="#">{pagesDefinition.titleCta}</a>
                </div>
            </div>
        </section>
    )
}
